  03> GRAY, Robert Charles m on 05.06.1993 to (2)LYONS, Kim
  b 16.11.1956
  b 30.03. ****
  Robert m. at Sydney, Australia. Address: 56 Castlereagh Street, Tahmoor 2573, NSW, Australia.
  Robert moved to Sydney in 1965 and completed high school matriculation. He travelled around
  Australia for a couple of years before returning to Sydney and training as a chartered accountant.
  He lived in Toronto, Canada, for a little over two years from late 1986 to early 1989. He is
  currently working as a chartered accountant.
  Kim has one child from her first marriage. She is a teacher and an accomplished artist.
