  b 12.12.1961
  Jacqueline b. at Vancouver, Canada, and m, at Sydney, Australia. Neil, s/o Brian and Edith
  Hinchliffe, b. at Manchester, England. Address: 188 Sailors Bay Road, Northbridge 2063, NSW,
  Australia.
  Jacqueline moved to Sydney in 1965 where, after completing high school, she worked as a finished
  artist in the advertising industry. She travelled extensively and lived and worked in Vancouver
  for about a year. She is currently undertaking studies in horticulture.
  Neil moved to Australia in 1987 and is a podiatrist.
