  Agnes b. at Waiohika and d, at Gisborne. Hugh b. in England and d, at Srinagar, Kashmir.
  Hugh attended Radley School in England and trained as a civil engineer. He went gold mining at Ross,
  British Columbia, Canada about 1900 and in 1910 he went to Kashmir where he 'built' the road to Gilgit via
  Burzil Pass. Subsequently he was manager of a carpet factory.
