  02> BLUNT, Michael Hugh m on 15.11.1958 to FIELD, Suzanne Mary
  b 05.03.1920 d **.06.1983
  b 03.08.1924 d 18.01.1983
  Michael b. at Srinagar, Kashmir and d. at Wellington.
  Michael qualified MRCVS, London, and served in the 14th Army and a veterinary officer during the
  re-capture of Burma. He was later a veterinarian at Ruatoria and Gisborne. He graduated PhD from the
  University of New England, NSW and undertook research in haematology at Augusta, Georgia, USA, and
  returned to New Zealand to take up a position of Assistant Director, Animal Health Division with the
  Ministry of Agriculture and Fisheries. Upon retirement, he became Executive Director of the New
  Zealand Veterinary Association.
